"""![5f2eb7b9-313d-44d3-8e82-5c292df1f348.jpg](data:image/jpeg;base64,) 

**Agora podemos calcular a incerteza da Área por meio da propagação de erros utilizando esta fórmula como exemplo, porém para dos dados da área, comprimento e largura.** 
"""

# Calculando as medias de C, L e A
Media_C = np.mean(tabela["C"])
print(Media_C)

Media_L = np.mean(tabela["L"])
print(Media_L)

A_Media = Media_C * Media_L

print(A_Media)

#Calculando a propagação de erros
Propagação = A_Media * np.sqrt((Erro_Media_Comprimento/Media_C)**2 + (Erro_Media_Largura/Media_L)**2)
print(Propagação)